import React from "react";

export default function CourseList(props) {
  const { title, type } = props;
  return (

    <div className="container">
      <div className="course">
        <h2 className="title">{title}</h2>
        <h2 className="type">{type}</h2>

        {props.children}
      </div>
    </div>
  );
}
